// Copyright (c) 2020 Siemens
/* eslint-env es6 */

/**
 * Constants for PLStats
 *
 * @module js/splmStatsConstants
 */

// Common
export const LAST_DIGEST_BUSY_WAIT = 200;

// Budget
export const BUDGET_HTTP_REQUEST_COUNT = 34; ////
export const BUDGET_HTTP_REQUEST_TIME = 1500;
export const BUDGET_HTTP_REQUEST_SIZE = 1000000; ////
export const BUDGET_DOM_NODE_COUNT = 1500;
export const BUDGET_MEMORY_USAGE = 20000000;
export const BUDGET_DOM_TREE_DEPTH = 32;
export const BUDGET_TTI = 2500;
export const PER_ELEMENT_WATCHER_LIMIT = 50;

// Error
export const ERROR_HTTP_REQUEST_COUNT = 68;
export const ERROR_HTTP_REQUEST_TIME = 30000;
export const ERROR_HTTP_REQUEST_SIZE = 2000000;
export const ERROR_DOM_NODE_COUNT = 10000;
export const ERROR_MEMORY_USAGE = 200000000;
export const ERROR_DOM_TREE_DEPTH = 64;
export const ERROR_TTI = 30000;
export const ERROR_MAX_CAPTURE_TIME = 60000;

// Delta - Actual reported by user vs. expected(budget values above)
export const DELTA_HTTP_REQUEST_COUNT = 10; ////
export const DELTA_HTTP_REQUEST_TIME = 1500;
export const DELTA_HTTP_REQUEST_SIZE = 250000; ////
export const DELTA_DOM_NODE_COUNT = 1000;
export const DELTA_MEMORY_USAGE = 100000;
export const DELTA_DOM_TREE_DEPTH = 8;
export const DELTA_TTI = 2000;

// Cucumber
export const CUCUMBER_BUDGET_HTTP_REQUEST_COUNT = 34; ////
export const CUCUMBER_BUDGET_HTTP_REQUEST_TIME = 1500;
export const CUCUMBER_BUDGET_HTTP_REQUEST_SIZE = 1000000; ////
export const CUCUMBER_BUDGET_DOM_NODE_COUNT = 1500;
export const CUCUMBER_BUDGET_MEMORY_USAGE = 20000000;
export const CUCUMBER_BUDGET_DOM_TREE_DEPTH = 32;
export const CUCUMBER_BUDGET_TTI = 2500;
export const CUCUMBER_BUDGET_NETWORK_ERRORS = 0;
export const CUCUMBER_BUDGET_SCRIPTING_TIME = 2000;

// Events
export const ANALYTICS_EVENT_NAME = 'PerformanceMetricsV1';

// Messages
export const ERROR_MAX_CAPTURE_TIME_LOG = 'ERROR - Maximum performance capture time exceeded';
export const CUCUMBER_PERFORMANCE_METRICS = 'CucumberPerformanceMetrics';
